import React from "react";
import { connect } from "react-redux";
import "./style.css";

class Summary extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    const { FinishEnvironmentReducer } = this.props;
    console.log("Summary: ", this.props.FinishEnvironmentReducer);
    return (
      <div className="Summary-main">
        <div className="top-Summary">
          <h2 className="Summmary-heading">Summary</h2>
          <div></div>
        </div>
        <div className="Summmary-content"></div>
        <div class="card">
          <div class="container">
            <h4><b>Jane Doe</b></h4>
    {/* <p>{FinishEnvironmentReducer}</p> */}
          </div>
        </div>

        <div className="bottom-Summary "></div>
      </div>
    );
  }
}

const mapStateToProps = state => ({
  FinishEnvironmentReducer: state.FinishEnvironmentReducer
});

const mapDispatchToProps = dispatch => {
  return {};
};
export default connect(mapStateToProps, mapDispatchToProps)(Summary);
